import React from 'react';
import './App.css';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar.js'
import ExecutiveBoard from './Components/Tabs/About/ExecutiveBoard';
import { Router, Route } from 'react-router-dom'

function App() {
  return (
    <div>
      <Header/>
      <Router>
        <NavigationBar />

        <Route
          path="/"
          exact
          render={() => 
          <div></div>}
        />

        <Route
          path="/about"
          exact
          render={() => 
          <ExecutiveBoard></ExecutiveBoard>}
        />

        <Route
          path="/events"
          exact
          render={() => 
          <div></div>}
        />

          <Route
          path="/contact"
          exact
          render={() => 
          <div></div>}
        />

          <Route
          path="/events"
          exact
          render={() => 
          <div></div>}
        />

      </Router>
    </div>
  );
}

export default App;
